import React from 'react';

function Welcome() {
    return (
        <div>
            <h1>ProRide Coaching</h1>
            <h2>Making cycling in school fun</h2>
            <img alt="phil bateman coaching in schools" src="../static/images/proride-kids-1.png" />
        </div>
    )
}

export default Welcome;
